import Vue from 'vue'
import App from './App.vue'
//引入路由
import router from '@/router/index.js'
//三级联动--全局组件
import TypeNav from '@/pages/Home/TypeNav/index.vue'
Vue.component('TypeNav', TypeNav)

//测试
import { reqCategory } from '@/api'
reqCategory()

Vue.config.productionTip = false
new Vue({
  render: (h) => h(App),
  router,
}).$mount('#app')
